style.css:
/* Change the background of the chat input area */
input, div { /* Target both input and div elements */
    background-color: orange !important; /* Background color */
    color: black !important; /* Text color */
    border: 1px solid #000; /* Optional border */
    border-radius: 5px; /* Rounded corners */
    padding: 10px; /* Inner padding */
}

/* Optional: Style for the placeholder text */
input::placeholder {
    color: black; /* Placeholder text color */
}
